import axios from "axios";
const customer = {};

customer.create = async (username, password,errorField) => {

  const datapost = {
    username: username,
    password: password,
    errorField: errorField
   
  }

  const res = await axios.post("http://localhost:8080/food-panda/customer",datapost)
  .then(response=>{ return response.data; })
  .catch(error=>{ return error.response; })
  
  return res;
}

export default customer
